            // Process the tables and display them on the page
            displayTables(tables);
          } catch (error) {
            console.error("Error fetching data:", error);
          }
        event.preventDefault();
        const data = { input: inputValue };
        console.log("aaaaaaaaaaaa" + inputValue)
